import { Component, OnInit } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent implements OnInit {
  title = 'Harbor Foods';
  contactForm!: FormGroup;
  contactdetails = {
    name: 'test',
    email: 'test@test.com',
    phone: '111-111-1111',
    company: 'FooBar',
    business: 'LorepIpsem',
  };
  ngOnInit(): void {
    this.contactForm = new FormGroup({
      name: new FormControl(this.contactdetails.name, [
        Validators.required,
        Validators.minLength(4),
      ]),
      email: new FormControl(this.contactdetails.email, [
        Validators.required,
        Validators.minLength(3),
        Validators.minLength(64),
      ]),
      phone: new FormControl(this.contactdetails.phone, [
        Validators.required,
        Validators.minLength(10),
        Validators.minLength(12),
      ]),
      company: new FormControl(this.contactdetails.company, [
        Validators.required,
        Validators.minLength(3),
        Validators.minLength(50),
      ]),
      business: new FormControl(this.contactdetails.business, [
        Validators.required,
        Validators.minLength(3),
        Validators.minLength(50),
      ]),
    });
  }
  get name() {
    return this.contactForm.get('name');
  }
  get phone() {
    return this.contactForm.get('phone');
  }
  get email() {
    return this.contactForm.get('email');
  }
  get company() {
    return this.contactForm.get('company');
  }
  get business() {
    return this.contactForm.get('business');
  }
  submit(): void {
    console.log('Submitted!');
  }
}
<div class="toolbar" role="banner">
  <span class="title-center">{{ title }}</span>
</div>

<div class="split-view-container">
  <div class="left">
    <ul>
      <li>RELATIONSHIPS MEAN SOMETHING</li>
    </ul>
    <div class="familyText">
      <span>Family-owned and</span>
      <span> operated since 1923</span>
    </div>
    <div style="margin-left: 25px; margin-top: 12px">
      <span>
        We're local like you and always by your side. Thats why our people work
        everyday to innovate and serve you the best possible solutions to run
        your business
      </span>
    </div>

    <router-outlet name="left"></router-outlet>
  </div>
  <div class="right">
    <app-contact-form></app-contact-form>
  </div>
</div>
<router-outlet></router-outlet>
